{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/edmondnathan/cyclistic-bike-share-analysis?scriptVersionId=132573557\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"3f1968d2","metadata":{"papermill":{"duration":0.008233,"end_time":"2023-06-06T23:53:07.12386","exception":false,"start_time":"2023-06-06T23:53:07.115627","status":"completed"},"tags":[]},"source":["# Cyclistic Bikeshare Case Study\n","\n","#### By\n","#  Edmond Nathan\n","### Data Analyst\n","#### 05-18-2023\n","\n","\n","## Case Study: How do annual members and casual riders use Cyclistic bikes differently?\n","\n","\n","## Background of the Cyclistic Bikeshare Dataset\n","Cyclistic is a fictitious bike share company that was established in 2016, providing bike-sharing services to Chicago with 5,824 bikes available in 692 docking stations. Their bike fleet includes various options such as reclining bikes, hand bicycles, and cargo bikes, catering to people with disabilities and those who prefer non-standard two-wheeled bikes. While most of their customers use the bikes for leisurely rides, approximately 30% use them daily for commuting to work. The subscription options available are casual riders with single-ride and full-day passes and Cyclistic members with annual membership.\n","\n","## Stakeholders\n","The stakeholders for the fictitious cyclistic bike share company are:\n","\n","1.   Director of marketing \n","2.   Cyclistic marketing analytics team\n","3.   Cyclistic executive team\n","4.   Bike users\n","\n","## Business Task\n","The business task is to better understand how annual members and casual riders use Cyclistic bikes differently. The insights derived from this analysis can then assist the marketing team in designing strategies that would help convert more casual riders into annual members.\n","\n","## Preparing the data\n","The Cyclistic data for the bike share was downloaded from <https://divvy-tripdata.s3.amazonaws.com/index.html> provided by **Motivate International Inc** under a strict license agreement. Owing to the privacy agreement, the data cannot be connected with personal information. However, since this data is owned by the city of Chicago and made available to the public through Divvy data system by licence agreement, we can say that this data has integrity since it ROCCCs (Reliable, Original, Comprehensive, Current and can be Cited).\n","\n","### Loading Packages\n","Prior to the importation of the dataset, all relevant packages for cleaning, analysis and visualization and installed and loaded into the RMarkdown."]},{"cell_type":"code","execution_count":1,"id":"08071528","metadata":{"execution":{"iopub.execute_input":"2023-06-06T23:53:07.141806Z","iopub.status.busy":"2023-06-06T23:53:07.140164Z","iopub.status.idle":"2023-06-06T23:53:08.555881Z","shell.execute_reply":"2023-06-06T23:53:08.554193Z"},"papermill":{"duration":1.427646,"end_time":"2023-06-06T23:53:08.558815","exception":false,"start_time":"2023-06-06T23:53:07.131169","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n","\n","Attaching package: ‘scales’\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    discard\n","\n","\n","The following object is masked from ‘package:readr’:\n","\n","    col_factor\n","\n","\n"]}],"source":["#Loading required packages\n","library(tidyverse)\n","library(dplyr)\n","library(scales)\n","library(ggthemes)\n","library(ggplot2)\n","library(skimr)\n","library(stats)\n","library(lubridate)"]},{"cell_type":"markdown","id":"6639fcf1","metadata":{"papermill":{"duration":0.007501,"end_time":"2023-06-06T23:53:08.574273","exception":false,"start_time":"2023-06-06T23:53:08.566772","status":"completed"},"tags":[]},"source":["### Importation of the Dataset\n","The read.csv() from the tidyverse package was used to import the Cyclistic bikeshare data: The 1st, 2nd, 3rd, and 4th quarter of the 2019 dataset into the RMarkdow and saved in dataframes called bs_trips_2019_q1, bs_trips_2019_q2, bs_trips_2019_q3, and bs_trips_2019_q4 respectively."]},{"cell_type":"code","execution_count":2,"id":"7ba1fe53","metadata":{"execution":{"iopub.execute_input":"2023-06-06T23:53:08.626677Z","iopub.status.busy":"2023-06-06T23:53:08.591944Z","iopub.status.idle":"2023-06-06T23:53:54.824351Z","shell.execute_reply":"2023-06-06T23:53:54.822877Z"},"papermill":{"duration":46.245113,"end_time":"2023-06-06T23:53:54.826647","exception":false,"start_time":"2023-06-06T23:53:08.581534","status":"completed"},"tags":[]},"outputs":[],"source":["#Loading the Cyclistic bikeshare data\n","bs_trips_2019_q1 <- read.csv(\"/kaggle/input/cyclistic-bikeshare-divvy-t