 for the 2nd quarter is different. This implies that the data will be manipulated before merging all the four quarters into a single year.\n","\n","### Data Clean and Wrangling\n","The variable name for quarter 2 was changed to match the column names of the 1st, 3rd, and 4th quarter for easy merging of the data using the join function from the dplyr package. The output was saved using the same dataframe name, then the quarter 2 dataframe is passed to colnames to confirm the change."]},{"cell_type":"code","execution_count":4,"id":"cce58d9a","metadata":{"execution":{"iopub.execute_input":"2023-06-06T23:53:54.998151Z","iopub.status.busy":"2023-06-06T23:53:54.996726Z","iopub.status.idle":"2023-06-06T23:53:55.05021Z","shell.execute_reply":"2023-06-06T23:53:55.048241Z"},"papermill":{"duration":0.066577,"end_time":"2023-06-06T23:53:55.052623","exception":false,"start_time":"2023-06-06T23:53:54.986046","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>'trip_id'</li><li>'start_time'</li><li>'end_time'</li><li>'bikeid'</li><li>'tripduration'</li><li>'from_station_id'</li><li>'from_station_name'</li><li>'to_station_id'</li><li>'to_station_name'</li><li>'usertype'</li><li>'gender'</li><li>'birthyear'</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 'trip\\_id'\n","\\item 'start\\_time'\n","\\item 'end\\_time'\n","\\item 'bikeid'\n","\\item 'tripduration'\n","\\item 'from\\_station\\_id'\n","\\item 'from\\_station\\_name'\n","\\item 'to\\_station\\_id'\n","\\item 'to\\_station\\_name'\n","\\item 'usertype'\n","\\item 'gender'\n","\\item 'birthyear'\n","\\end{enumerate*}\n"],"text/markdown":["1. 'trip_id'\n","2. 'start_time'\n","3. 'end_time'\n","4. 'bikeid'\n","5. 'tripduration'\n","6. 'from_station_id'\n","7. 'from_station_name'\n","8. 'to_station_id'\n","9. 'to_station_name'\n","10. 'usertype'\n","11. 'gender'\n","12. 'birthyear'\n","\n","\n"],"text/plain":[" [1] \"trip_id\"           \"start_time\"        \"end_time\"         \n"," [4] \"bikeid\"            \"tripduration\"      \"from_station_id\"  \n"," [7] \"from_station_name\" \"to_station_id\"     \"to_station_name\"  \n","[10] \"usertype\"          \"gender\"            \"birthyear\"        "]},"metadata":{},"output_type":"display_data"}],"source":["# Renaming the q2 data for uniformity of column names with q1, q3 and q4\n","bs_trips_2019_q2 <- bs_trips_2019_q2 %>% \n","  rename(trip_id = X01...Rental.Details.Rental.ID, start_time = X01...Rental.Details.Local.Start.Time, end_time = X01...Rental.Details.Local.End.Time, bikeid = X01...Rental.Details.Bike.ID, tripduration = X01...Rental.Details.Duration.In.Seconds.Uncapped, from_station_id = X03...Rental.Start.Station.ID, from_station_name = X03...Rental.Start.Station.Name,  to_station_id = X02...Rental.End.Station.ID, to_station_name = X02...Rental.End.Station.Name,  \n","             usertype = User.Type, gender = Member.Gender, birthyear = X05...Member.Details.Member.Birthday.Year)\n","\n","colnames(bs_trips_2019_q2)"]},{"cell_type":"markdown","id":"b316a9ce","metadata":{"papermill":{"duration":0.008742,"end_time":"2023-06-06T23:53:55.07023","exception":false,"start_time":"2023-06-06T23:53:55.061488","status":"completed"},"tags":[]},"source":["### Merging the datasets\n","In order to obtain the Cyclistic bike share data for the year 2019, the data from the four quarters of that year were merged. The merge operation was performed using the full_join() function from the dplyr package since all the data points were considered important and had the same number and types of variables. The merged dataset was then saved as a dataframe named bike_share_trips_2019_merged. The rbind() could also have been used to merge the four dataframe into one."]},{"cell_type":"code","execution_