e: 2 × 5\n","\n","| membership_type &lt;chr&gt; | total_rides &lt;int&gt; | percent &lt;dbl&gt; | ymax &lt;dbl&gt; | ymin &lt;dbl&gt; |\n","|---|---|---|---|---|\n","| Casual |  856923 | 22.6 |  22.6 |  0.0 |\n","| Member | 2934162 | 77.4 | 100.0 | 22.6 |\n","\n"],"text/plain":["  membership_type total_rides percent ymax  ymin\n","1 Casual           856923     22.6     22.6  0.0\n","2 Member          2934162     77.4    100.0 22.6"]},"metadata":{},"output_type":"display_data"}],"source":["#summarizing the total number of rides and percentages, ymax and ymin\n","total_rides_by_membership <- bike_share_trips_filtered %>% \n","  group_by(membership_type) %>% \n","  summarise(total_rides = n()) %>% \n","  mutate(percent = round(total_rides/sum(total_rides)*100,2),\n","         ymax = cumsum(percent), \n","         ymin = c(0, head(ymax, n=-1)))\n","View(total_rides_by_membership) #This results displays data frame for the total number of casual and member of the membership type"]},{"cell_type":"markdown","id":"9e2ee495","metadata":{"papermill":{"duration":0.012255,"end_time":"2023-06-06T23:54:53.471383","exception":false,"start_time":"2023-06-06T23:54:53.459128","status":"completed"},"tags":[]},"source":["First, the total rides by membership was calculated. The proportion for each membership type is also calculated and visualized.\n"," \n","The results of the total rides by membership type are piped, using the pipe operator from the dplyr package, into ggplot to visualize the proportion of total rides for each membership type. This visualization is achieved with the aid of a doughnut chart."]},{"cell_type":"code","execution_count":18,"id":"3637ef43","metadata":{"execution":{"iopub.execute_input":"2023-06-06T23:54:53.536797Z","iopub.status.busy":"2023-06-06T23:54:53.535378Z","iopub.status.idle":"2023-06-06T23:54:53.899024Z","shell.execute_reply":"2023-06-06T23:54:53.896798Z"},"papermill":{"duration":0.380127,"end_time":"2023-06-06T23:54:53.901451","exception":false,"start